import React, { Component } from 'react'

export default class Affairs extends Component {

  affairs = [
    {
      id: 1,
      data: '12.12.2023',
      time: '14:36',
      text: 'Забрать документы из МФЦ',
      checked: true,
    },
    {
      id: 2,
      data: '12.17.2023',
      time: '17:30',
      text: 'Записаться в зал',
      checked: false,
    },
    {
      id: 3,
      data: '01.04.2024',
      time: '08:30',
      text: 'Поехать во Мценск',
      checked: false,
    },
    
  ]

  render() {
    return (
      <div>
        {this.affairs.map((el) => (
          <div>
            <h2>{el.data}</h2>
            <h3>{el.time}</h3>
            <p>{el.text}</p>
          </div>
        ))}
      </div>
    )
  }
}
